import React from 'react'
// import testChildComponent   from './testChildComponent'

class Login extends React.Component {

  render() {
    return (
      <div>
        <h1>Login</h1>
        <form >
          <label>
            Name:
            <input type="text" />
          </label>
          <input type="submit" value="Submit" />
        </form>
      </div>
    )
    }
  }

export default Login
